import React, { Component } from 'react';
import Navigation from './Components/Navigation/Navigation';
import Logo from './Components/Logo/Logo';
import ImageLinkForm from './Components/ImageLinkForm/ImageLinkForm';
import Rank from './Components/Rank/Rank'
// import FaceRecognition from './Components/FaceRecognition/FaceRecognition';
import Particles from 'react-particles-js';
import './App.css';

const particleOptions = {
	particles: {
		number: {
			value: 30,
		density: {
			enable: true,
			value_area: 800,
		}
	}
}
}

class App extends Component {
	constructor() {
		super();
		this.state = {
			input: '',
		}
	}


onInputChange = (event) => {
	console.log(event.target.value);
}

// To get the value of the input, you need to use the above code in the console.log paramaters

onClick = () => {
	console.log('Click');
}

render() {
	return (
		<div className="App">
			 <Particles className='Particles1'
			 	params={particleOptions}
			 />
			 <Navigation />
			 <Logo />
			 <Rank />
			 <ImageLinkForm onInputChange={this.onInputChange}/> 
		      {/*<FaceRecognition />*/}
		</div>
	);
}
}

export default App;


 // For onInputChange to work, you have to use this. as it is a property of the app, otherwise it is undefined and will not register.
